exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions),encoding:"gbk"};return parseCatalogPaginate(page=>`https://www.kanqishuwu.com/${bid.idPrefix()}_${bid}${1===page?"":"_"+page}/`,".section-list",{...options,clientOptions,pageSize:50,totalPagesRegex:/第\s*\d+\/(?<totalPages>\d+)\s*页<\/a>/})};